import React , { Component } from 'react'
import { NoteConsumer } from '../context'
import Note from './Note'

export default class NoteList extends Component {
  state = {
    notes : []
  }
   render() { 
    return (
        <React.Fragment>
              <NoteConsumer>
                {(value) => {
                   return value.notes.map( note => {
                     return < Note key={note.id} note={note} />
                   })
                }}
              </NoteConsumer>
        </React.Fragment>
    )
            } 
}
